import React, { useState, FormEvent, useEffect } from "react";
import { FiChevronRight, FiStar } from "react-icons/fi";
import { GoStar, GrFavorite } from "react-icons/all";
import { Link } from "react-router-dom";
import {} from "@material-ui/core";
import api from "../../services/api";
import { Title, Form, Info, Error, Header, Button } from "./styles";
import Logo from "../../assets/logo.png";

const Dashboard: React.FunctionComponent = () => {
  const [newRepo, setNewRepo] = useState("");
  const [inputError, setInputError] = useState("");

  return (
    <>
      <div
        style={{
          display: "flex",
          position: "sticky",
          height: "100px",
          width: "100%",
          alignItems: "center",
          backgroundColor: "#ECA15B",
          top: 0,
        }}
      >
        <div
          style={{
            width: "100%",
            margin: "0px 40px 0px 100px",
            display: "flex",
            justifyContent: "space-between",
          }}
        >
          <img
            style={{
              position:"absolute",
              marginTop:'-20px',
              marginLeft:"-20px",
              display: "block",
              width: "60px",
              height: "60px",
            }}
            src={Logo}
            alt="aa"
          />
          <div>
            <span>Contei</span>
          </div>

          <div style={{ display: "flex", gap: "50px" }}>
            <span>Home</span>
            <span>About</span>
            <span>Contact Us</span>
            <span></span>
          </div>
        </div>
      </div>

      <div
        style={{
          background: "gray",
          height: "100%",
          padding: "50px 50px",
          overflow: "auto",
        }}
      >
        <Header>Contei</Header>
        <Title>Explore Star Wars Characters</Title>
      </div>
    </>
  );
};

export default Dashboard;
